@EU_Commission Dear @EU_Commission 

As you have clearly finished your No Deal homework, please can you help the British government with theirs?

Thank you from a powerless, voiceless Brit. xxx

@EU_Commission OK, prepare for Brexit.
But, do not forget to prepare for re-entry.
@jeremycorbyn @CBildt

@EU_Commission How about no?
I'm not interested in living in an UDSSR revival experiment.
More de-centralization and dissolving the EU is the way to go.

@EU_Commission "A ‘no-deal’ scenario on 1 November 2019 very much remains a possible, although undesirable, outcome."
Well, since you basically try to push them into a corner, a no-deal Brexit becomes the only viable option for GB.
It's not ideal, but it's the only option you've left them.

@EU_Commission @TimmermansEU @VeraJourova @ChristianWigand @EU_Justice If the right to information really applies, citizens hit by a US sealed indictment have their basic rights violated and shouldn’t be extradited to the US.

Correct?

#Assange

@EU_Commission @EUflagmafia It may seem cheap, but if you have a dripping tap, you fix it.
As for all the "benefits" such as safe food, and foreign education. Are you honestly trying to say that without the EU, Great Britain would not have such things, or continue to have them outside the EU?
How Stupid!!!
